import React from 'react';
import {Text, View,StyleSheet} from 'react-native';

const Boards=(props)=>{
    return(
        <View style={styles.container}>
            
        </View>
    );

    styles = StyleSheet.create({
        container:{
            backgroundColor:'#e3e3e3',
            width:'100%',
            height:30,
        }
    });
}


export default Boards
